import { Component } from "react"
import Navbar from "../Navbar/Navbar"

export default class Home extends Component{
    state={
        productName: 'Toshiba c3',
        price: 3000,
        type: 'Mobile Phone'
    }
    render(){
        return(
            <>
            <Navbar/>
              <h1 className="text-cecnter">Product</h1>
              <div className="p-3 bg-info w-50 m-auto my-5">
                <h3><i class="fa-solid fa-skull-crossbones"></i>{this.state.productName} </h3> 
                <h3><i class="fa-solid fa-skull-crossbones"></i>{this.state.price} </h3> 
                <h3><i class="fa-solid fa-skull-crossbones"></i>{this.state.type} </h3> 
              </div>


            </>
        )
    }
}
